import React, { useState } from 'react';
import axios from 'axios';

const InfoForm=() => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [workExperience, setWorkExperience] = useState('');
  const [qualifications, setQualification] = useState('');
  const [role, setRole] = useState('');
  const [techSkills, setTechSkills] = useState('');
  const [businessImpact, setBusinessImpact] = useState('');
  const [coursesTaught, setCoursesTaken] = useState('');
  const [yearsOfExperience, setYearsExperience] = useState('');

  const handleSubmit = async (event) => {
      event.preventDefault();

      if (!firstName || !lastName || !email || !role) {
          alert('Please fill in all required fields');
          return;
        }

      if (role === 'developer' && (!techSkills || !businessImpact)) {
      alert('Please fill in all required fields for the developer role');
      return;
      }

      if (role === 'tutor' && (!coursesTaught || !yearsOfExperience)) {
      alert('Please fill in all required fields for the tutor role');
      return;
      }

      const formData = {
          firstName,
          lastName,
          email,
          workExperience,
          qualifications,
          role,
          techSkills: role === 'developer' ? techSkills : undefined,
          businessImpact: role === 'developer' ? businessImpact : undefined,
          coursesTaught: role === 'tutor' ? coursesTaught : undefined,
          yearsOfExperience: role === 'tutor' ? yearsOfExperience : undefined,
      };

      // console.log(formData);

      try {
        const response = await axios.post('http://localhost:8080/api/resume/create', formData);
        console.log(response.data);
        alert('Resume created successfully');
      } catch (error) {
        console.error(error);
        alert('An error occurred. Please try again later');
      }
    };



  const handleRoleChange = (e) => {
    setRole(e.target.value);
  };


  return (
    <form >
      <div className="space-y-25 px-8 pt-32 pb-32 ">
        <div className="border-b border-gray-900/10 pb-10 mx-72">
          <h2 className="text-base font-semibold leading-7 text-gray-900">Create Resume</h2>
          <p className="mt-1 text-sm leading-6 text-gray-600">
            This information will be used to Create Resume
          </p>
        </div>
        <div className="border-b border-gray-900/10  mx-72">
          <h2 className="text-base font-semibold leading-7 text-gray-900">Personal Information</h2>
          <p className="mt-1 text-sm leading-6 text-gray-600">Use a permanent address where you can receive mail.</p>

          <div className="mt-10 grid grid-cols-1 gap-x-6 gap-y-8 sm:grid-cols-6">
            <div className="sm:col-span-3">
              <label htmlFor="first-name" className="block text-sm font-medium leading-6 text-gray-900">
                First name
              </label>
              <div className="mt-2">
                <input
                  type="text"
                  name="first-name"
                  id="first-name"
                  autoComplete="given-name"
                  className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-sky-600 sm:text-sm sm:leading-6"
                />
              </div>
            </div>

            <div className="sm:col-span-3">
              <label htmlFor="last-name" className="block text-sm font-medium leading-6 text-gray-900">
                Last name
              </label>
              <div className="mt-2">
                <input
                  type="text"
                  name="last-name"
                  id="last-name"
                  autoComplete="family-name"
                  className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-sky-600 sm:text-sm sm:leading-6"
                />
              </div>
            </div>

            <div className="sm:col-span-4">
              <label htmlFor="email" className="block text-sm font-medium leading-6 text-gray-900">
                Email address
              </label>
              <div className="mt-2">
                <input
                  id="email"
                  name="email"
                  type="email"
                  autoComplete="email"
                  className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-sky-600 sm:text-sm sm:leading-6"
                />
              </div>
            </div>

            <div className="col-span-full">
              <label htmlFor="qualification" className="block text-sm font-medium leading-6 text-gray-900">
                Qualification
              </label>
              <div className="mt-2">
                <input
                  type="text"
                  name="qualification"
                  id="Qualification"
                  autoComplete="street-address"
                  className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-sky-600 sm:text-sm sm:leading-6"
                />
              </div>
            </div>
            <div className="col-span-full">
              <label htmlFor="about" className="block text-sm font-medium leading-6 text-gray-900">
                Experience Summary
              </label>
              <p className="mt-3 text-sm leading-6 text-gray-600">Briefly specify you top Experiences.</p>
              <div className="mt-2">
                <textarea
                  id="about"
                  name="about"
                  rows={3}
                  className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 placeholder:text-gray-400 focus:ring-2 focus:ring-inset focus:ring-sky-600 sm:text-sm sm:leading-6"
                  defaultValue={''}
                />
              </div>
            </div>
            <div className="sm:col-span-3">
              <label htmlFor="country" className="block text-sm font-medium leading-6 text-gray-900">
                Country
              </label>
              <div className="mt-2">
                <select
                  id="country"
                  name="country"
                  autoComplete="country-name"
                  className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 focus:ring-2 focus:ring-inset focus:ring-indigo-600 sm:max-w-xs sm:text-sm sm:leading-6"
                >
                  <option value="">Select Role</option>
            <option value="developer">Developer</option>
            <option value="tutor">Tutor</option>
                </select>
              </div>
            </div>
          </div>
        </div>

        <div className="mt-6 flex items-center justify-end gap-x-6 space-y-25 px-8  mx-72">
        <button type="button" className="text-sm font-semibold leading-6 text-gray-900">
          Cancel
        </button>
        <button
          type="submit"
          className="rounded-md bg-indigo-600 px-3 py-2 text-sm font-semibold text-white shadow-sm hover:bg-indigo-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600"
        >
          Save
        </button>
      </div>
      </div>


    </form>
  );
}

export default InfoForm;
